import Nav from "./Nav";

const Layout = props => {
  return (
    <div>
      <Nav />
      <div className="layout">{props.children}</div>
      <style jsx global>
        {`
          *,
          *::before,
          *::after {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
          }
        `}
      </style>
      <style>
        @import
        url('https://fonts.googleapis.com/css?family=Montserrat:400,500,600&display=swap');
      </style>
    </div>
  );
};

export default Layout;
